// src/components/ui/Button.js
const Button = ({ children, className, ...props }) => {
    return (
      <button
        className={`bg-blue-600 text-white py-2 px-4 rounded-md hover:bg-blue-700 focus:outline-none ${className}`}
        {...props}
      >
        {children}
      </button>
    );
  };
  
  export default Button;
